const edgesJson = require(".././data/json/edges.json");

const colors = {
  1: "#46f0f0",
  2: "#228b22",
  3: "#7f0000",
  4: "#00008b",
  5: "#ff8c00",
  6: "red",
  7: "#00ff00",
  8: "#00ffff",
  9: "#ff00ff",
  10: "#1e90ff",
  11: "#ff69b4",
  12: "black",
  13: '#e6194b',
  14: '#3cb44b',
  15: '#ffe119',
  16: '#f58231',

};

export const initialEdges = edgesJson.map(({ target, ...edge }) => {
  if (target.includes("C")) {
    const color = colors[target.charAt(1)];
    console.log(color);

    return { target, ...edge, style: { stroke: `${color}` } };
  }
  return { target, ...edge };
});

